import React from 'react'; 
import './App.css';
import Navbar from './components/navbar/Navbar';
import Main from './components/main/Main';
import Content from './components/courses/Content';
import Team from './components/teamContent/Team';
import Teacher from './components/teachers/Teacher';
import Form from './components/form/Form';
import Footer from './components/footer/Footer';
import Prefer from './components/prefer/Prefer';
import Company from './components/company/Company';
import { BrowserRouter,Route,Routes } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <div className="container">
        <Navbar />
        <Routes>
          <Route path="/" element={<Main />} />
          <Route path="/courses" element={<Content />} />
          <Route path="/aboutTeam" element={<Team />} />
        </Routes>
        <Teacher />
        <Form />
        <Prefer />
        <Company />
        <Footer />
      </div>
    </BrowserRouter>
  );
}

export default App;
